import './ItemDialogs.css';
import {NavLink} from "react-router-dom";

const ItemDialogs = (props) => {
	return (
		<NavLink className="item_dialogs__link" to={`/dialogs/${ props.number || 1 }`}>
			<li className='item_dialogs'>
					<div className="item_dialogs__content">{props.name || 'Anonym'}</div>
			</li>
		</NavLink>
	)
}

export default ItemDialogs;
